  author_nickname: Erica Ramos [CA] [Call Mod]
  content: "Starting tomorrow (Sunday), we're starting the Roll Call Challenge! \U0001F3B6\
    \ The Democratic National Convention was packed full of energy, inspiration and\
    \ JOY! \U0001F64C <:celebrate:1252803817095958548> The innovation of doing the\
    \ state/territory Roll Call to music inspired by each was definitely a highlight\
    \ and we wanted to bring some of that to this group. If you didn't see the Roll\
    \ Call live, check it out here - https://youtu.be/sMYMSIuxXFY?si=HTzC0TAF8HWA_xrk&t=121.\n\
    \nEvery day between now and the election, we'll have a competition between two\
    \ songs representing states/territories/etc. from the DNC Roll Call. You'll vote\
    \ for your choice of songs by adding an emoji and the one with the most \"votes\"\
    \ will go on to the next round. We'll post the songs for the day in the morning\
    \ and collect all votes after 9 pm ET. Election Day will be our Championship too!\
    \ \U0001F499 \n\nMake sure you come back every day to vote for your favorites\
    \ and to see the winner. Everything will stay in this Thread so you can find it\
    \ easily!"
